CREATE DATABASE Demostracion;

USE Demostracion;

CREATE TABLE cov_h_camas(
   id				    INT PRIMARY KEY AUTO_INCREMENT
  ,fecha                DATE  NOT NULL
  ,hospital             VARCHAR(37) NOT NULL
  ,camas_ocupadas_total INTEGER 
  ,camas_uci_ocupadas   INTEGER 
  ,municipio            VARCHAR(22) NOT NULL
  ,provincia            VARCHAR(8) NOT NULL
  ,codigo_ine           INTEGER  NOT NULL
  ,observaciones        VARCHAR(88)
);

CREATE TABLE cov_m_provincias (
	id INT PRIMARY KEY AUTO_INCREMENT,
	provincia VARCHAR(200)
);

SELECT DISTINCT provincia 
FROM cov_h_camas;

CREATE TABLE cov_m_municipios (
	id INT PRIMARY KEY AUTO_INCREMENT,
	municipio VARCHAR(200),
	id_provincia INT NOT NULL,
	FOREIGN KEY (id_provincia) REFERENCES cov_m_provincias(id)
);

SELECT DISTINCT municipio, (SELECT id FROM cov_m_provincias p WHERE c.provincia = p.provincia)
FROM cov_h_camas c;

CREATE TABLE cov_m_hospitales (
	id INT PRIMARY KEY AUTO_INCREMENT,
	hospital VARCHAR(200),
	id_municipio INT NOT NULL,
	FOREIGN KEY (id_municipio) REFERENCES cov_m_municipios(id)
);


SELECT DISTINCT hospital, (SELECT id FROM cov_m_municipios p WHERE c.municipio= p.municipio)
FROM cov_h_camas c;

ALTER TABLE cov_h_camas DROP COLUMN provincia;
ALTER TABLE cov_h_camas DROP COLUMN municipio;

ALTER TABLE cov_h_camas ADD id_hospital INT NOT NULL;
UPDATE cov_h_camas SET id_hospital = (SELECT id FROM cov_m_hospitales h WHERE h.hospital = cov_h_camas.hospital)
ALTER TABLE cov_h_camas ADD CONSTRAINT fk_hospital FOREIGN KEY (id_hospital) REFERENCES cov_m_hospitales(id);


ALTER TABLE cov_h_camas DROP COLUMN hospital;



